import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="bg-blue-600 text-white p-4 flex items-center justify-between">
    {/* Logo / Title */}
    <h1 className="text-xl font-bold">Booking System</h1>

    {/* Center Links */}
    <div className="absolute left-1/2 transform -translate-x-1/2 space-x-6">
      <Link to="/" className="hover:underline">Home</Link>
      <Link to="/booking" className="hover:underline">Book</Link>
      <Link to="/dashboard" className="hover:underline">Dashboard</Link>
      <Link to="/admin" className="hover:underline">Admin</Link>
    </div>

    {/* Right Buttons */}
    <div className="space-x-2">
      <Link to="/login" className="bg-white text-blue-600 px-3 py-1 rounded hover:bg-gray-100">
        Login
      </Link>
      <Link to="/signup" className="bg-yellow-400 text-blue-900 px-3 py-1 rounded hover:bg-yellow-300">
        Sign Up
      </Link>
    </div>
  </nav>
);

export default Navbar;
